class Solution:
    def cross_river(self, P: int, R: int, L: int, graph: List[List[int]]) -> int:
        left_river = -1
        right_river = R-1
        visited = [False]*R
        for _ in range(L):
            log_index = 0
            while log_index < L:
                log_index += 1
                if not graph[log_index-1][1] == right_river:
                    left_river, right_river = right_river, left_river
                    graph[log_index-1][1] = right_river
                    graph[log_index-1][2] = left_river
                if not visited[right_river]:
                    visited[right_river] = True
                    yield right_river
                    right_river -= 1
                if not visited[left_river]:
                    visited[left_river] = True
                    yield left_river
                    left_river += 1
        for i in range(P):
            yield -1

