class Solution:
    def solution(self, N: int, s: List[str]) -> str:
        # Find the longest clue string that does not contain s as a substring
        for i in range(1, N):
            prefix = ''.join([s[i-1]]*len(s[i-1]))
            if prefix not in s:
                break
        else:
            return -1

        # Find the smallest clue string
        smallest_clue = None
        for i in range(1, N):
            for j in range(i):
                if s[i] in s[j]:
                    continue
                if smallest_clue is None or len(s[i]) < len(s[smallest_clue]):
                    smallest_clue = s[i]

        return smallest_clue

